import { View, Text, ScrollView, Image } from "react-native";
import { Style } from "./SharedStyle";
import room_image from "../assets/room_image.jpg";

export default function MembersScreen({ navigation, route }) {
  const { item } = route.params;
  console.log(item);
  return (
    <View style={Style.custom_modal_container}>
      {/* <View style={Style.custom_modal_wrapper}>
        <Text>Modal</Text>
      </View> */}
      <View style={Style.room_members_scrollview_wrapper}>
        <ScrollView
          style={Style.room_members_container}
          showsVerticalScrollIndicator={false}
        >
          <View style={Style.room_members_wrapper}>
            <Image
              style={Style.room_details_members_image}
              source={room_image}
            />
            <Text style={Style.room_details_members_title}>{item.name}</Text>
          </View>
          <View style={Style.room_members_wrapper}>
            <Image
              style={Style.room_details_members_image}
              source={room_image}
            />
            <Text style={Style.room_details_members_title}>{item.name}</Text>
          </View>
          <View style={Style.room_members_wrapper}>
            <Image
              style={Style.room_details_members_image}
              source={room_image}
            />
            <Text style={Style.room_details_members_title}>{item.name}</Text>
          </View>
          <View style={Style.room_members_wrapper}>
            <Image
              style={Style.room_details_members_image}
              source={room_image}
            />
            <Text style={Style.room_details_members_title}>{item.name}</Text>
          </View>
          <View style={Style.room_members_wrapper}>
            <Image
              style={Style.room_details_members_image}
              source={room_image}
            />
            <Text style={Style.room_details_members_title}>{item.name}</Text>
          </View>
        </ScrollView>
      </View>
    </View>
  );
}
